pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

contract Logging {
    string public name;
    uint public logCount = 0; 
    mapping(uint => Log) public logs;
    
    struct Log {
        uint id;
        string username;
        uint timestamp;
    }

    event LogAdded (
        uint id,
        string username,
        uint timestamp
    );
    
    constructor() public {
        name = "SsorinLogger";
    }

    function createLog(Log[] memory _array) public {
        // add info
        for (uint i = 0; i < _array.length; i++) {
            logs[logCount] = _array[i];
            logCount++;
            // trigger on event
            emit LogAdded(_array[i].id, _array[i].username, _array[i].timestamp);
        }
    }
}
